import React, { useState } from 'react';
import P1 from './P1';
import './l1.css';

function L1() {
    const [result,setResult]=useState(false);
    function handleClick(){
        setResult(true);
    }
  return (
        result ? <P1 />   :
        <div className='L1-body'>
        <h1>Alphabets</h1>
        <p>Similar to the alphabets in English,we have 52 alphabets in telugu.These alphabets are divided into two parts.They are
            <ol>
                <li>Vowels (16)</li>
                <li>Consonants (38)</li>
            </ol>
            Let's start with Vowels. Click on <u>Next</u> to continue.
        </p>
        <button onClick={handleClick}>Next</button>
        </div>
  )
}

export default L1
